  false,\n\t\"url\": null,\n\t\"notes\": \"Automatic Identification Systems (AIS)
  are a navigation safety device that transmits and monitors the location and characteristics
  of many vessels in U.S. and international waters in real-time. This dataset represents
  the density of pleasure craft and sailing vessel traffic in 2011 for the contiguous
  United States offshore waters from pleasure craft or sailing vessels with AIS transponders
  in 100 meter grid cells. The dataset is best interpreted using a high to low density
  scale and does not represent actual vessel counts.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
